   {
    path:'/home',
    display:'Home'
   },
   {
    path:'#',
    display:'About'
   },
   {
    path:'/tours',
    display:'Tours'
   },
  ] 

const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          <div className="nav__wrapper d-flex align-items-center
           justify-content-between">

            {/*=========logo=========== */}
            <div className="logo">
              <img scr={logo} alt="" />
            </div>
            {/*=========logo end=========== */}

            {/*=========Menu Start=========== */}
            
            {/*=========Menu Start=========== */}

          </div>
        </Row>
      </Container>
    </header>
  )
}

export default Header
